import React from 'react'
import '../Cards/Cardstyle.css';
import Img1 from '../Cards/Cardimg1.webp'

function Card() {
  return (
    <>
   
<div class="card">
  <img style={{width:"230px"}} class="card-img" src={Img1} alt="Card image cap"/>
  <div class="card-body">
    <p class="card-text"></p>
  </div>
</div>
    
</>
  )
}

export default Card
